import React from 'react'
import { Link, NavLink } from "react-router-dom";
const AboutUs = () => {
  return (
    <>
    <div>About Us</div>
    <NavLink to="/">Go to Home Page </NavLink>
    <Link to="/contact-us"> Go to Contact Us</Link>
  </>
  )
}

export default AboutUs
